import React, { useState, useEffect } from "react";
import '../App.css';

const ComplainDetails = () => {
  const [complaints, setComplaints] = useState([]);
  const [startDate, setStartDate] = useState("2025-02-19");
  const [endDate, setEndDate] = useState("2025-02-26");
  const [selectedType, setSelectedType] = useState("");
  const [selectedStatus, setSelectedStatus] = useState("");

  useEffect(() => {
    // Fetching data from API (Replace with actual API endpoint)
    fetch("https://api.example.com/complaints") // Change API URL
      .then((response) => response.json())
      .then((data) => setComplaints(data))
      .catch((error) => console.error("Error fetching complaints:", error));
  }, []);

  useEffect(() => {
    const sampleData = [
      {
        id: "1005",
        type: "electricity",
        status: "Open",
        mobile: "1234567888",
        location: "37.421998,-122.084",
      },
      {
        id: "1006",
        type: "water",
        status: "Open",
        mobile: "1234567888",
        location: "37.421998,-122.084",
      }
    ];
    setComplaints(sampleData);
  }, []);

  // Function to filter complaints based on selected type and status
  const filteredComplaints = complaints.filter((complaint) => {
    return (
      (selectedType ? complaint.type === selectedType : true) &&
      (selectedStatus ? complaint.status === selectedStatus : true)
    );
  });

  return (
    <div className="complaint-details-container">
      <h2>Complaint Details</h2>

      {/* Date Range Section */}
      <div className="flex-container">
        <div>
          <label className="label">Start Date:</label>
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            className="input-box"
          />
        </div>
        <div>
          <label className="label">End Date:</label>
          <input
            type="date"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
            className="input-box"
          />
        </div>
      </div>

      {/* Filters Section */}
      <div className="flex-container">
        <div>
          <label className="label">Complaint Type:</label>
          <select
            value={selectedType}
            onChange={(e) => setSelectedType(e.target.value)}
            className="dropdown"
          >
            <option value="">Complaint Type</option>
            <option value="electricity">Electricity</option>
            <option value="water">Water</option>
            <option value="road">Road</option>
          </select>
        </div>
        <div>
          <label className="label">Complaint Status:</label>
          <select
            value={selectedStatus}
            onChange={(e) => setSelectedStatus(e.target.value)}
            className="dropdown"
          >
            <option value="">Complaint Status</option>
            <option value="Open">Open</option>
            <option value="Closed">Closed</option>
          </select>
        </div>
      </div>

      {/* Complaints List */}
      <div>
        {filteredComplaints.map((complaint) => (
          <div key={complaint.id} className="complaint-card">
            <p>
              <strong>Complaint ID:</strong>{" "}
              <a href={`/complaintDetailspage`} className="text-blue-500">
                {complaint.id}
              </a>
            </p>
            <p>
              <strong>Type:</strong> {complaint.type}
            </p>
            <p>
              <strong>Status:</strong> {complaint.status}
            </p>
            <p>
              <strong>Mobile No:</strong> {complaint.mobile}
            </p>
            <p>
              <strong>Location:</strong> {complaint.location}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ComplainDetails;
